import React from 'react'

const ListTable = () => {
  return (
    <>
      <Table
      bordered
      rowKey="_id"
      columns={columns}
      // dataSource={data}
      dataSource={users}
      pagination={{ defaultPageSize: PAGE_SIZE }}
    />
    </>
  )
}
export default ListTable
